most illustrious producers. Well-known for his thunderous DJ sets and deep, bass-heavy house productions, ‘Erased Dreams’ may seem like a departure from Yotto’s usual style, but he’s always made music like this. With Reflections, he finally found a home for it.logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1716,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1716,logseq____&quot;^Flogseq____&quot;,1715,536870963]],[logseq____&quot;^15logseq____&quot;,[1716,logseq____&quot;^Xlogseq____&quot;,602,536870963]],[logseq____&quot;^15logseq____&quot;,[1716,logseq____&quot;^Vlogseq____&quot;,602,536870963]],[logseq____&quot;^15logseq____&quot;,[1716,logseq____&quot;^Ulogseq____&quot;,602,536870963]],[logseq____&quot;^15logseq____&quot;,[1716,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u6715a25c-05a4-4013-b1f3-ce5e80cc2897logseq____&quot;,536870963]],[logseq____&quot;^15logseq____&quot;,[1717,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;Throughout his sparkling career, which includes a Billboard #1 LP and remixes of tracks by Joris Voorn, Gorillaz and Coldplay, Yotto has produced ambient music to help him look inward and re-charge his creative battery. But when COVID hit, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870963]],[logseq____&quot;^15l  <script type="text/javascript">// Single Page Apps for GitHub Pages

      // This script checks to see if a redirect is present in the query string
      // and converts it back into the correct url and adds it to the
      // browser's history using window.history.replaceState(...),
      // which won't cause the browser to attempt to load the new url.
      // When the single page app is loaded further down in this file,
      // the correct url will be waiting in the browser's history for
      // the single page app to route accordingly.
      (function(l) {
        if (l.search) {
          var q = {};
          l.search.slice(1).split('&').forEach(function(v) {
            var a = v.split('=');
            q[a[0]] = a.slice(1).join('=').replace(/~and~/g, '&');
          });
          if (q.p !== undefined) {
            window.history.replaceState(null, null,
              l.pathname.slice(0, -1) + (q.p || '') +
              (q.q ? ('?' + q.q) : '') +
              l.hash
            );
          }
        }
      }(window.location))</script>
